     , (10980, 13 /* QuestFailure_EmoteCategory */, 2, 0, 18 /* DirectBroadcast_EmoteType */, 0, 1, NULL, 'Aun Hareltah cocks his head to the side, as if listening to something inaudible.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10980, 13 /* QuestFailure_EmoteCategory */, 2, 1, 18 /* DirectBroadcast_EmoteType */, 1, 1, NULL, '"Wind has brought tidings of your deeds, friend. She whispers, ''%s has slain the brutal Temepuh, who calls himself Temenua as he hunts your people on the upland. Temenua, who sheds your xuta''s blood at the behest of the soulless atua ngamaru.''"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10980, 13 /* QuestFailure_EmoteCategory */, 2, 2, 18 /* DirectBroadcast_EmoteType */, 2, 1, NULL, '"This deed is a fiery blaze upon your keh, Isparian, even if you know it not. Should you desire the Hoeroa of Palenqual, give me Temepuh''s totem."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10980, 13 /* QuestFailure_EmoteCategory */, 2, 3, 18 /* DirectBroadcast_EmoteType */, 2, 1, NULL, '"But if you do not desire this fighting staff, if you would rather have the magical Stave or the ranged Kalindan, hold your hand for now. I will only reward you once for the butcher''s death."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
