     , (10980, 13 /* QuestFailure_EmoteCategory */, 10, 0, 10 /* Tell_EmoteType */, 0, 1, NULL, 'Hrm... so you claim to have slain Temepuh?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10980, 13 /* QuestFailure_EmoteCategory */, 10, 1, 18 /* DirectBroadcast_EmoteType */, 1, 1, NULL, 'Aun Hareltah places the totem in the palm of his hand, and closes his eyes. After a brief moment, he shakes his head and hands the totem back to you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10980, 13 /* QuestFailure_EmoteCategory */, 10, 2, 10 /* Tell_EmoteType */, 2, 1, NULL, 'No, I fear you are attempting to deceive me. Your keh would sing of this victory quite plainly - it does not. You should return this to the one who actually killed the scourge of the uplands.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
