     , (10980, 13 /* QuestFailure_EmoteCategory */, 12, 4, 17 /* LocalBroadcast_EmoteType */, 1, 0, NULL, '"Great anima of decay," he intones solemnly, "bear no ill will towards %s, who slew your servant respectfully."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
