     , (10980, 13 /* QuestFailure_EmoteCategory */, 12, 6, 17 /* LocalBroadcast_EmoteType */, 0, 0, NULL, '"From this point forward, %s shall be known and honored among all Aun as Queenslayer."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
