     , (10980, 13 /* QuestFailure_EmoteCategory */, 12, 8, 17 /* LocalBroadcast_EmoteType */, 3, 0, NULL, '"Further," Hareltah says with a smile, "%s shall be known as my adopted kin!"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
