     , (10980, 13 /* QuestFailure_EmoteCategory */, 12, 10, 17 /* LocalBroadcast_EmoteType */, 3, 0, NULL, '"You have saved this xuta," Hareltah says gravely, his powerful voice carrying over the susurrations of the crowd. "For this, for all your experiences on the path to defeating the Queen, the hardest road known in these strange lands, I recognize you."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
