     , (10980, 13 /* QuestFailure_EmoteCategory */, 12, 14, 17 /* LocalBroadcast_EmoteType */, 3, 0, NULL, '"Finally," Hareltah says, "there is the matter of this totem in my hands. I will prepare it for you with my own hands, my kin, that you may hang from your wall. With its power, your house shall be mighty among Tonk and Isparian, and none shall wash the earth from under it."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
