     , (10980, 6 /* Give_EmoteCategory */, 0, 3, 10 /* Tell_EmoteType */, 1, 1, NULL, 'This is a work of Aun magic. You say you took this from a Hea? I have little wonder. This is a Totem of Tanae, the Forest, who wraps the world in his green arms, whispers deep wisdoms, and, on our world of Ezheret-Hazahtu, shelters our people from the great sisters Wind and Rain, as they eternally grapple for the love of Father Sea.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
